        </Button>
        <Button variant="secondary" size="md">
          Work Experience
        </Button>
        */
/**
 * 
 * @returns 
 */
function Experience() {
  return (
    //<div className="d-grid gap-2">
    <Row className="d-lg-row gap-2">
      <ButtonGroup size="lg" className="mb-2 gap-4">
        <DropdownButton>

        </DropdownButton>
      </ButtonGroup>
    </Row>
    //</div>
  );
}


/**
 * 
 * @returns  
 */
export default function App() {
  //return <ButtonBox buttons={ NAMES }/>;
  return (
    <Container fluid>
      <Header />
      <AboutMe />
      <ContactMe />
    </Container>
    );
}
